import LayoutPattern from './components/layout/LayoutPattern'
import 'antd/dist/antd.css'
import './App.css';

const App = ()=> {
  return (
    <div className="App">
      <LayoutPattern>
        <div> Testing the children</div>
      </LayoutPattern>
    </div>
  );
}

export default App;
